import React from 'react'
import styled from 'styled-components'
import { NavLink } from 'react-router-dom'

const JJModal: React.FC = () =>{

    return(
        <StyledBackDrop to='/projects' exact>
            <StyledModal></StyledModal>
        </StyledBackDrop>
    )
}
const StyledBackDrop = styled(NavLink)`
background-color: rgba(0,0,0,0.6);
width: 100%;
height: 100%;
position: absolute;
left: 0;
top: 0;
`

const StyledModal = styled.div`
width: 50%;
height: 50%;
position: absolute;
top:25%;
left:25%;
`

export default JJModal
